Humans once wielded formidable magical power. But with over 7 billion of us on the planet now, Mana has spread far too thinly to have any effect. When hostile aliens reduce humanity to a mere fraction, the survivors discover an old power has begun to reawaken once again. Being that this power can be good or evil, mana can be extremely dangerous when it falls into the wrong hands. 

The first step taken by the human survivors is to guard the pjower of the mana, to be used only for good. The leader of the survivors calls for a council meeting to map out a strategy to prevent further alien invasion. How did the invasion occur and how else might it occur in the future? These answer these questions, a brilliant think tank comprised of men and women went into over drive. They came up with a plan to prevent any further alien invasion. They would use the power of mana to create a force field that would prevent any alien from entering earth.

With the new force field in place, the humans began to propagate. It was strongly suggested to limit each couple to two children. ;
